sys_ux_client_script.script:
/**
* @param {params} params
* @param {api} params.api
* @param {any} params.event
* @param {any} params.imports
* @param {ApiHelpers} params.helpers
*/
function handler({api, event, helpers, imports}) {
    if(api.state.parkingListSortState === "all") {
        api.setState("sortingState", "");
    } else if (api.state.parkingListSortState == "active") {
        api.setState("sortingState", true);
    } else {
        api.setState("sortingState", false);
    }
console.log(`vykis 4 ${api.state.sortingState}`)
}
